// sets up back buffer for double buffering
void init_double_buffer(volatile int * pcp){
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pcp;

    /* set front pixel buffer to Buffer 1 */
    *(pcp + 1) = (int) &Buffer1; // first store the address in the back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    clear_screen();
    wait_for_vsync();
    /* set back pixel buffer to Buffer 2 */
    *(pcp + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pcp + 1); // we draw on the back buffer
    clear_screen();
}
// draw all enemies and sprites
void draw(){
    // iterate through number of frames
        for(int k = 0; k < 6; k++){
            clear_screen();
            draw_enemy_sprite_frame(goblin_D_attack, 10, 10, k, 6);
            draw_enemy_sprite_frame(goblin_D_Walk, 10*k, 10*k, k, 6);
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        }
}
// draws an enemy sprite starting from its top left corner (x_offset, y_offset)
void draw_enemy_sprite_frame(unsigned short int sprite_ptr[][288], unsigned int x_offset, unsigned int y_offset, unsigned int frame_idx, unsigned int num_frames){
    // iterate through the height of a frame
    unsigned int sheet_height = ARRAYSIZE(goblin_D_attack);
    unsigned int sheet_width = ARRAYSIZE(goblin_D_attack[0]);
    for(unsigned int i = 0; i < sheet_height; i++){
        // iterate through the width of a frame 
        for(unsigned int j = (sheet_width / num_frames) * frame_idx; j < (sheet_width / num_frames) * (frame_idx + 1); j++){
            // remove background
            if(sprite_ptr[i][j] != 0xFFFF){
                plot_pixel(x_offset + (j % sheet_height), y_offset + i, sprite_ptr[i][j]);
           }
        }
    }
}

void wait_for_vsync() {
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    int status;

    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);
    while((status & 1) != 0x0){
        status = *(pixel_ctrl_ptr + 3);
    }
}
